import logo from './logo.svg';
import './App.css';
import React from 'react';

class Hello extends React.Component {
    render() {
        return (
        <div>
            <h1> Hello World </h1>
            <p>Welcome to React</p>
        </div>
        )
    }
}

export default Hello;
